INSERT INTO sightings VALUES (6564,'We definitely saw and heard a chickadee several times today. After having satisfied ourselves that it was a Black-capped Chickadee, we paid it little mind, unaware that the Cape May birdlist considers Carolina Chickadee to be the only one occuring with sufficient frequency to warrant a listing. So, that must be what we say. We will count it on the trip list, but not on the life list, not yet.',1,0,15,22090010100,254);
