INSERT INTO sightings VALUES (9328,'Seen by Mary, Bill, and R. J. only.\r\nThe winter plumage adult ruff was a seen at approximately 1:00.  It was a medium grey/brown shorebird, evenly colored above with a small head. The clean white underside was cleanly divided from the solid colored upper parts in a smooth line. Only Bill and RJ saw it on the ground before the entire shorebird flock was spooked by a Prairie Falcon flying low over the pond.  In flight, the ruff was larger than the dowitchers it flew away with and showed a distinct white pattern of white across the tail and up both sides of the rump, making a U shape.',0,0,138,11061150100,334);
