INSERT INTO sightings VALUES (9613,'<p>This guy landed just ten feet in front of me, and held still for long enough to snap off a few shots.</p>\r\n\r\n<p>Bob Power notes: \"[this bird] has that classic rectangular blocky head look of a Coop. Brown streaks indicate juvenile. Sharpy\'s don\'t raise their hackles and always look round-headed.  Streaks get blotchy or spotty as you go down the flanks, not more thickly streaked like the Sharp-shinned.  Flanks should be more contrasty (orange flanks vs. brown back) if it was a juvie sharp-shinned.\"</p>',0,1,19,8012080300,365);
