INSERT INTO sightings VALUES (10936,'at least 3 individual seen in the parking lot of our hotel in Harlingen were initially assumed to be Couch\'s Kingbirds until  we woke up enough to pay attention to their trilled song.  By playing the trilled song of the Tropical from recordings and observing the their green backs we confirmed the ID.  The recorded Tropical song attracted the birds closer; Couch\'s song did not.  They were twitter-pated, chasing one another when not chittering from the wires overhead.',0,0,147,22013050100,407);
