INSERT INTO sightings VALUES (16198,'Juvenile accipiter entered the brush beside our parked car, was very difficult to see in the brush.  Only the breast & belly were well-seen, and these were strongly streaked with markings degenerating to a series of nearly distinct triangle marks about halfway down the breast.  The bird eventually flew through the brush and made a right angle turn to cross the parking lot directly in front of us. Both observers spent more time saying \\\"Ooooh\\\" than noting field marks on this flight - result: no ID, but a beautiful memory.\r\n\r\nThere was an active Cooper\\\'s Hawk nest in this parking lot in spring 2007, so tentative ID is Cooper\\\'s Hawk, but the more accurate ID is \\\"accipiter sp.\\\"',0,0,164,8012080300,577);
